    ["env", {
      "spec": true,
      "useBuiltIns": false
    }], ["stage-0"], ["es3"]
  ],
  "plugins": [
    [
      "transform-react-jsx",
      {
        "pragma": "createElement"
      }
    ],
    [
      "transform-runtime",
      {
        "helpers": false,
        "polyfill": false,
        "regenerator": true,
        "moduleName": "babel-runtime"
      }
    ]
  ]
}

module.exports = {
  extends: ['standard', 'standard-jsx'],
  ecmaFeatures: {
    classes: true
  },
  env: {
    browser: true,
    node: true,
    es6: true
  },
  rules: {
    'no-unused-expressions': 0,
    'prefer-const': ['error']
  },
  globals: {
    describe: true,
    it: true,
    beforeAll: true,
    beforeEach: true,
    afterEach: true,
    afterAll: true,
    expect: true,
    jasmine: true,
    jest: true
  },
  parser: 'babel-eslint'
}

const fs = require('fs')
const path = require('path')
const cp = require('child_process')
const isCI = require('is-ci')

const karmaPath = path.join(__dirname, 'node_modules', 'karma')

function upgradeKarma () {
  if (!isCI) {
    return
  }
  console.log(`you are using socket.io version under 2.x, upgrading now...`)
  cp.execSync('npm install socket.io@2.0.3', {
    cwd: karmaPath
  })
}

try {
  const { version } = JSON.parse(
    fs.readFileSync(
      path.join(karmaPath, 'node_modules', 'socket.io', 'package.json')
    )
  )
  if (parseInt(version, 10) < 2) {
    upgradeKarma()
  }
} catch (e) {
  upgradeKarma()
}

module.exports = {
  coverageDirectory: 'coverage',
  coverageReporters: ['html', 'lcov', 'text'],
  collectCoverageFrom: [
    'packages/nerv/src/**/*.ts'
  ],
  moduleFileExtensions: ['ts', 'tsx', 'js', 'jsx', 'json'],
  moduleNameMapper: {
    nervjs: '<rootDir>/packages/nerv/src',
    'nerv-create-class': '<rootDir>/packages/nerv-create-class',
    'nerv-devtools': '<rootDir>/packages/nerv-devtools',
    'nerv-redux': '<rootDir>/packages/nerv-redux',
    'nerv-shared': '<rootDir>/packages/nerv-shared',
    'nerv-test-utils': '<rootDir>/packages/nerv-test-utils',
    'nerv-utils': '<rootDir>/packages/nerv-utils'
  },
  globals: {
    'ts-jest': {
      tsConfig: {
        target: 'es5',
        removeComments: false,
        preserveConstEnums: true,
        moduleResolution: 'node',
        experimentalDecorators: true,
        noImplicitAny: false,
        allowSyntheticDefaultImports: true,
        strictNullChecks: true,
        noImplicitThis: true,
        sourceMap: true
      },
      diagnostics: false
    }
  },
  rootDir: __dirname,
  testMatch: [
    // '<rootDir>/packages/nerv/__tests__/cloneElement.spec.js',
    // '<rootDir>/packages/nerv/__tests__/component.spec.js',
    // '<rootDir>/packages/nerv/__tests__/render.spec.js',
    // '<rootDir>/packages/nerv/__tests__/lifecycle.spec.js',
    // '<rootDir>/packages/nerv/__tests__/svg.spec.js'
    // '<rootDir>/packages/nerv/__tests__/event.spec.js'
    // '<rootDir>/packages/**/__tests__/**/*spec.js'
    '<rootDir>/packages/**/__tests__/**/*spec.js'
  ],
  transform: {
    '^.+\\.jsx?$': 'babel-jest',
    '^.+\\.tsx?$': 'ts-jest'
  },
  transformIgnorePatterns: ['<rootDir>/node_modules/(?!lodash-es)']
}

const webpack = require('webpack')
const path = require('path')
const ES3 = require('es3ify-webpack-plugin')
const resolve = pkg => path.join(__dirname, './packages', pkg, 'src')
const coverage = String(process.env.COVERAGE) !== 'false'
const ci = String(process.env.CI).match(/^(1|true)$/gi)
const realBrowser = String(process.env.BROWSER).match(/^(1|true)$/gi)
const sauceLabs = realBrowser && ci
const sauceLabsLaunchers = {
  sl_win_chrome: {
    base: 'SauceLabs',
    browserName: 'chrome',
    platform: 'Windows 10'
  },
  sl_mac_chrome: {
    base: 'SauceLabs',
    browserName: 'chrome',
    platform: 'macOS 10.12'
  },
  sl_firefox: {
    base: 'SauceLabs',
    browserName: 'firefox',
    platform: 'Windows 10'
  },
  sl_mac_firfox: {
    base: 'SauceLabs',
    browserName: 'firefox',
    platform: 'macOS 10.12'
  },
  sl_safari: {
    base: 'SauceLabs',
    browserName: 'safari',
    platform: 'macOS 10.12'
  },
  sl_edge: {
    base: 'SauceLabs',
    browserName: 'MicrosoftEdge',
    platform: 'Windows 10'
  },
  sl_ie_11: {
    base: 'SauceLabs',
    browserName: 'internet explorer',
    version: '11.103',
    platform: 'Windows 10'
  },
  sl_ie_10: {
    base: 'SauceLabs',
    browserName: 'internet explorer',
    version: '10.0',
    platform: 'Windows 7'
  },
  sl_ie_9: {
