const prompts = require('prompts')
const cp = require('child_process')

async function f () {
  const response = await prompts({
    type: 'select',
    name: 'version',
    message: `What's the release version?`,
    choices: [
      { title: 'auto (by semver version)', value: 'auto' },
      { title: 'beta', value: 'beta' },
      { title: 'manual', value: 'manual' }
    ],
    initial: 1
  })

  const { version } = response
  const command = 'npm run build && lerna publish --exact --conventional-commits'
  switch (version) {
    case 'auto':
      cp.execSync(command)
      break
    case 'beta':
      cp.execSync(command + '--cd-version=prepatch --preid=beta --npm-tag=beta')
      break
    case 'manual':
      const manual = await prompts({
        type: 'text',
        name: 'version',
        message: `What's the EXACT version that you want to publish?`
      })
      cp.execFileSync(`${command} --repo-version ${manual.version}`)
      break
    default:
      break
  }
}

f()

const dts = require('dts-bundle')
const { join } = require('path')

const cwd = process.cwd()
const pkgJSON = require(join(cwd, 'package.json'))

if (pkgJSON.name === 'nerv-redux') {
  return
}

try {
  const name = pkgJSON.name === 'nervjs' ? 'nerv' : pkgJSON.name
  dts.bundle({
    main: join(__dirname, 'lib', 'packages', name, 'src/index.d.ts'),
    name: pkgJSON.name,
    out: join(cwd, 'dist/index.d.ts')
  })
  console.log(`${pkgJSON.name} in typings is DONE`)
} catch (e) {
  throw Error(e)
}
